import random

NUM_OF_STEPS = 100000
NUM_OF_ITERATIONS = 2


# get src url and list of link [src_url, dst_url]
# return list of all dst_urls that have from src (empty list if none)
def get_linked_nodes(src_url, listOfPairs):
    pairs_with_src = list(filter(lambda pairs: pairs[0] == src_url, listOfPairs))
    return list(map(lambda pairs: pairs[1], pairs_with_src))


# get a list and return random node in the list
# if is pair - its a list of lists, return src random node
# else - its a list of linked nodes, just return one of them
def get_random_node(lst, is_pair=True):
    random_index = random.randint(0, len(lst) - 1)
    random_object = lst[random_index]
    random_url = random_object[random_index % 2] if is_pair else random_object
    return random_url


# update dictionary - add 1 to the key of the url that seen
def update_dict(rank_dict, current_node, i):
    if current_node in rank_dict.keys():
        rank_lst = rank_dict[current_node]
        rank_lst[i] += 1
    else:  # first time
        rank_lst = [0, 0]
        rank_lst[i] = 1
    rank_dict[current_node] = rank_lst
    return rank_dict


# divide each value by number of steps
def normalized_ranks(rank_dict):
    for pair in rank_dict.values():
        pair[0] /= NUM_OF_STEPS
        pair[1] /= NUM_OF_STEPS


def playerPageRank(listOfPairs):
    rank_dict = {}
    current_node = get_random_node(listOfPairs)  # get first node (randomly)
    for iteration in range(NUM_OF_ITERATIONS):
        for step in range(NUM_OF_STEPS):
            rank_dict = update_dict(rank_dict, current_node, iteration)  # add 1 to seen list
            rnd = random.random()
            linked_nodes = get_linked_nodes(current_node, listOfPairs)
            # prob 0.85 or the node have links - get the next node
            if rnd <= 0.85 and len(linked_nodes) != 0:
                # get random nodes from the linked list
                current_node = get_random_node(linked_nodes, is_pair=False)
            else:  # if there are no outgoing links or prob 0.15
                # get random node from the whole list
                current_node = get_random_node(listOfPairs)

    normalized_ranks(rank_dict)  # divide each value by number of steps
    return rank_dict


